import React from "react";
import DiagramSVG from "./DiagramSVG";
import Modals from "./Modals";
import EbookIcon from "../../Assets/Icons/EbookIcon.png";
import PDFIcon from "../../Assets/Icons/PDFIcon.png";
import PPTIcon from "../../Assets/Icons/PPTIcon.png";
import EditIcon from "../../Assets/Icons/TOCEditIcon.svg";
import "../../Styles/App.css";

export const Diagram = ({
  anchorCharts,
  setAnchorCharts,
  multiGlossaries,
  setMultiGlossaries,
  notice,
  setNotice,
  multiParent,
  setMultiParent,
  multiSummaries,
  setMultiSummaries,
  authentic,
  setAuthentic,
  summaries,
  setSummaries,
  textSketch,
  setTextSketch,
}) => {
  return (
    <div className="main-diagram">
      <div className="diagram-container">
        <DiagramSVG
          className="diagram-svg"
          alt="diagra"
          anchorCharts={anchorCharts}
          setAnchorCharts={setAnchorCharts}
          multiGlossaries={multiGlossaries}
          setMultiGlossaries={setMultiGlossaries}
          notice={notice}
          setNotice={setNotice}
          multiParent={multiParent}
          setMultiParent={setMultiParent}
          multiSummaries={multiSummaries}
          setMultiSummaries={setMultiSummaries}
          authentic={authentic}
          setAuthentic={setAuthentic}
          summaries={summaries}
          setSummaries={setSummaries}
          textSketch={textSketch}
          setTextSketch={setTextSketch}
        />
        <section className="key-box">
          <div>
            <h4 className="diagram-key-title">Key to icons</h4>
            <div className="icons-container">
              <div className="icons-column-left">
                <span className="icons-item top">
                  <img
                    className="key-icon editable"
                    alt="editable icon"
                    src={EditIcon}
                  />
                  <p className="icons-item-text editable">Editable</p>
                </span>
                <span className="icons-item bottom">
                  <img
                    className="key-icon"
                    alt="printable icon"
                    src={PDFIcon}
                  />
                  <p className="icons-item-text">Printable</p>
                </span>
              </div>
              <div className="icons-column-right">
                <span className="icons-item top">
                  <img className="key-icon" alt="ebook icon" src={EbookIcon} />
                  <p className="icons-item-text">Printable</p>
                </span>
                <span className="icons-item bottom">
                  <img
                    className="key-icon"
                    alt="Powerpoint icon"
                    src={PPTIcon}
                  />
                  <p className="icons-item-text">Printable</p>
                </span>
              </div>
            </div>
          </div>
        </section>
      </div>
      <div className="modals-container">
        <Modals
          anchorCharts={anchorCharts}
          setAnchorCharts={setAnchorCharts}
          multiGlossaries={multiGlossaries}
          setMultiGlossaries={setMultiGlossaries}
          notice={notice}
          setNotice={setNotice}
          multiParent={multiParent}
          setMultiParent={setMultiParent}
          multiSummaries={multiSummaries}
          setMultiSummaries={setMultiSummaries}
          authentic={authentic}
          setAuthentic={setAuthentic}
          summaries={summaries}
          setSummaries={setSummaries}
          textSketch={textSketch}
          setTextSketch={setTextSketch}
          className="modals"
        />
      </div>
    </div>
  );
};

export default Diagram;
